import React, { useState } from 'react';
import './styles.css';

const App = () => {
  const [pageComponents, setPageComponents] = useState([]);

  // Function to handle adding components by clicking in the sidebar
  const addComponent = (item) => {
    const newComponent = {
      ...item,
      id: `${item.id}-${Date.now()}`,
    };

    setPageComponents((prev) => [...prev, newComponent]);
  };

  return (
    <div className="app">
      <Sidebar addComponent={addComponent} />
      <MainContent pageComponents={pageComponents} />
    </div>
  );
};

// Sidebar with clickable items
const Sidebar = ({ addComponent }) => {
  const components = [
    { id: 'text1', type: 'TEXT', content: 'This is a text block.' },
    { id: 'button', type: 'BUTTON', content: 'Click Me' },
    { id: 'link', type: 'LINK', content: 'Visit Levi\'s', url: 'https://www.levi.com' },
    { id: 'image', type: 'IMAGE', content: 'Image of Jeans', url: 'https://via.placeholder.com/150' },
    { id: 'video', type: 'VIDEO', content: 'Product Video', url: 'https://www.youtube.com/embed/dQw4w9WgXcQ' },
  ];

  return (
    <div className="sidebar">
      <h2>Sidebar</h2>
      {components.map((item) => (
        <div
          key={item.id}
          className="draggable-item"
          onClick={() => addComponent(item)}
        >
          {item.content}
        </div>
      ))}
    </div>
  );
};

// Main content area where items will be added
const MainContent = ({ pageComponents }) => {
  return (
    <div className="main-content">
      {/* Mobile Frame */}
      <div className="mobile-frame">
        <MobilePage pageComponents={pageComponents} />
      </div>
    </div>
  );
};

// Mobile Page (template) that contains the header, footer, and dynamic components
const MobilePage = ({ pageComponents }) => {
  return (
    <div className="mobile-content">
      {/* Header */}
      <Header />
      {/* Dynamically added components */}
      <div className="components">
        {pageComponents.map((component) => (
          <Component key={component.id} component={component} />
        ))}
      </div>
      {/* Footer */}
      <Footer />
    </div>
  );
};

// Component to render added items (buttons, text, images, etc.)
const Component = ({ component }) => {
  return (
    <div className="component">
      {component.type === 'TEXT' && <p>{component.content}</p>}
      {component.type === 'BUTTON' && <button className="regular-button">{component.content}</button>}
      {component.type === 'LINK' && <a href={component.url} target="_blank" rel="noopener noreferrer">{component.content}</a>}
      {component.type === 'IMAGE' && <img src={component.url} alt={component.content} />}
      {component.type === 'VIDEO' && <iframe src={component.url} title={component.content} width="100%" height="200" />}
    </div>
  );
};

// Header Component (inside the mobile frame)
const Header = () => {
  const headerData = {
    imageUrl: 'https://via.placeholder.com/800x200',
    title: 'Welcome to Our Website',
    description: 'Explore our products and services.',
  };

  return (
    <div className="header" style={{ backgroundImage: `url(${headerData.imageUrl})` }}>
      <div className="header-content">
        <h1>{headerData.title}</h1>
        <p>{headerData.description}</p>
      </div>
    </div>
  );
};

// Footer Component (inside the mobile frame)
const Footer = () => {
  const footerData = {
    contactInfo: 'Contact us: info@website.com',
    socialLinks: [
      { name: 'Facebook', url: 'https://www.facebook.com' },
      { name: 'Twitter', url: 'https://www.twitter.com' },
      { name: 'Instagram', url: 'https://www.instagram.com' },
    ],
  };

  return (
    <div className="footer">
      <p>{footerData.contactInfo}</p>
      <div className="social-links">
        {footerData.socialLinks.map((link) => (
          <a key={link.name} href={link.url} target="_blank" rel="noopener noreferrer">
            {link.name}
          </a>
        ))}
      </div>
    </div>
  );
};

export default App;
